@AccessControl.authorizationCheck: #NOT_REQUIRED
@EndUserText.label: 'Vehicle Inward Header Projection View'
@Search.searchable: true
@Metadata.allowExtensions: true
define root view entity ZWBI_C_VEHIN_HEAD 
 provider contract transactional_query
  as projection on ZWBI_I_VEHIN_HEAD 
{
  key Inward_Uuid,
      @Search.defaultSearchElement: true   
      
        
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_WTTKT_F4_HELP', element: 'Wticknum' } ,     
                     additionalBinding: [{ localElement: 'Plant', element: 'Plants' },
                                     { localElement: 'Intype', element: 'Intype' }
                                     ] }]        
      Ticknum, 
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_I_InwardTypeSTDVH',
                         element: 'value_low'} ,
                         distinctValues: true
                      }]       
               
      Intype,
      Fiscal,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_INDATE_F4', element: 'Indaten' },
        additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }  ]
                          } ]
      Indate,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_INBT_F4', element: 'Intimen' },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ,
                         { localElement: 'Plant', element: 'Plants' }  ] 
                         } ]
      Intime,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_VEH_F4', element: 'Vehnumn' }, 
       
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ]
    //                     { localElement: 'Plant', element: 'Plants' }   ] 
       } ]
      Vehnum,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_DN_F4', element: 'Drivnamen' }, 
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ] //,
  //                       { localElement: 'Plant', element: 'Plants' }  ] 
   } ]
      Drivname,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_DNO_F4', element: 'Drivnumn' },
      additionalBinding: [{ localElement: 'Drivname', element: 'Drivnamen' }, 
      { localElement: 'Intype', element: 'Intypen' } ]
       //                  {  localElement: 'Plant', element: 'Plants' }  ] 
        } ]
      Drivnum,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_TRN_F4', element: 'Trannamen' },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ]
      //                   { localElement: 'Plant', element: 'Plants' }   ]  
      } ]
      Tranname, 

      @Search.defaultSearchElement: true
      Orderhead,      
      
     @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_C_PLANT_F4',
                         element: 'Plant' },
                         useForValidation:true,  //03-04
                         distinctValues: true
                      }] 
     @ObjectModel.text.element: ['_Planttext.PlantName']   
     @UI.textArrangement: #TEXT_LAST               
      Plant, 
/*      @ObjectModel.virtualElementCalculatedBy: 'ABAP:/N4C03/WBI_CTRL_PNAME'
      virtual PlantName : abap.char( 30 ), //plant text creting virtual field */
      Planttext,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_OT_F4', element: 'Otypen' },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ] 
                          } ]
      Type,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_DC_F4', element: 'Dchanneln' } , 
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ] 
                         } ]
      Dchannel,
      Range,
      Printform,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_TWD_F4', element: 'Pwidaten' },
        additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ]
                           } ]
      Pwidate,
      Pwiempwg,
      Pwigetwg,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_TWT_F4', element: 'Pwitimen' },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ,
                         { localElement: 'Plant', element: 'Plants' }  ] 
                          } ]
      Pwitime,
      Pwiuom,
      Itemunit,
       @Semantics.quantity.unitOfMeasure : 'Itemunit'
            
//   @Consumption.filter.hidden: false
      Grossweight,
//      @Semantics.quantity.unitOfMeasure : 'Itemunit'
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_NETWEIGHT_F4', element: 'Netweightt' } } ] 
//     @Consumption.filter.hidden: true
      Netweight,
      Pwoempwg,  
      Pwogetwg,
       @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_GWTD_F4', element: 'Pwodaten' },
        additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ]  } ]
      Pwodate, 
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_GWTT_F4', element: 'Pwotimen' },
       additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ] 
                          } ]
      Pwotime,     
      Pwexit,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_OBD_F4', element: 'Pwexitdtn' },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ]  } ]
      Pwexitdt,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_OBT_F4', element: 'Pwexittmn' }, 
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ] } ]
      Pwexittm,
      Hdevlstatus,  
      shippoint,
      shipptext,
     
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_GROSSWEIGHT_F4', element: 'Gweightf' },//}]
      additionalBinding: [{ localElement: 'Gunit_f',  element: 'Gunitf' }]
//                         { localElement: 'Plant', element: 'Plants'  }, 
//                          { localElement: 'Intype', element: 'Intypen'   }  ] 
 }]                          
      Pwoempwg_f,      //gross weight      
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_TAREWEIGHT_F4', element: 'Tweightf'  },//}]
      additionalBinding: [{ localElement: 'Tunit_f',  element: 'Tunitf' } ]
 //                        { localElement: 'Plant', element: 'Plants' },
 //                      {  localElement: 'Intype', element: 'Intypen'} ]
       } ] 
      Pwiempwg_f,    //Tare weight     
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_GW_UOM_FIL', element: 'Gunitf'  },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }    ]  } ]     
      Gunit_f,            
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_TW_UOM_FIL', element: 'Tunitf'  },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ] 
       } ]        
      Tunit_f,   
            Itemunit_f, //25/10/2024
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_TGW_F4', element: 'Grossweight_fn'  } 
//      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' }, 
//                         { localElement: 'Plant', element: 'Plants' } ]
 //                        { localElement: 'Gunit_f',  element: 'Pwiuom_fn'}   ] 
 } ]
       
       
      Grossweight_f,
        @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_GW_F4', element: 'Netweight_fn' }
//      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
//                         { localElement: 'Plant', element: 'Plants' }   ] 
                          } ]     
      Netweight_f,
           
      Pwiuom_f,           
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_CBY_F4', element: 'CreatedByn' },
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ]  } ]
      CreatedBy,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_CON_F4', element: 'CreatedOnn' } ,
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' },
                         { localElement: 'Plant', element: 'Plants' }   ]  } ]
      CreatedOn,
      @Consumption.valueHelpDefinition: [{ entity: { name: 'ZWBI_CTM_F4', element: 'CreatedTmn' } ,
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ,
                         { localElement: 'Plant', element: 'Plants' }  ] } ]
      CreatedTm,
       @Consumption.hidden: true 
      CreatedAt,
       @Consumption.hidden: true 
      LastChangedBy,
       @Consumption.valueHelpDefinition: [{ entity: {  name: 'ZWBI_LCO_F4', element: 'Lastchangedon' } ,
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ,
                         { localElement: 'Plant', element: 'Plants' }  ] 
      }] 
      LastChangedOn,
      @Consumption.hidden: true 
      LastChangedAt,
      LocalLastChangedAt,
       @Consumption.valueHelpDefinition: [{ entity: {  name: 'ZWBI_LCB_F4', element: 'Lastchangedbyn' } ,
      additionalBinding: [{ localElement: 'Intype', element: 'Intypen' } ,
                         { localElement: 'Plant', element: 'Plants' }  ] 
      }] 
      Last_changed_by_n,  
      Eflag,
      /* Associations */
      _Planttext,     
      _Item : redirected to composition child ZWBI_C_VEHIN_ITEM   
 
        
 
} 

